import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Dashboard } from '../dashboard/dashboard';
import { EpisodesResponse } from '../dashboard/interfaces/episodes-response';

@Injectable({
  providedIn: 'root'
})
export class DashboardService {

  //private apiUrl = 'https://rickandmortyapi.com/api/';
  private apiUrl = 'https://rickandmortyapi.com/api/episode';

  constructor(private http: HttpClient) { }

  getData(page: number): Observable<EpisodesResponse> {
    var url = page == 1 ? this.apiUrl : this.apiUrl + '?page=' + page;
    var res = this.http.get<EpisodesResponse>(this.apiUrl);
    console.log("res:", res);
    return res;
  }
}
